import React from "react";
import {FormControlLabel, Radio, RadioGroup} from "@mui/material";
import {z} from "zod";
import {useForm} from "react-hook-form";
import {zodResolver} from "@hookform/resolvers/zod";
import IconButton from "material-ui/core/IconButton";
import InputLabel from "material-ui/core/InputLabel";
import Visibility from "material-ui/icons/Visibility";
import InputAdornment from "material-ui/core/InputAdornment";
import VisibilityOff from "material-ui/icons/VisibilityOff";
import Input from "material-ui/core/Input";

const AdminLogin = ({}) => {

    const schema = z.object({

    });


    const {register, handleSubmit, formState, control} = useForm({resolver: zodResolver(schema)});

    const {errors} = formState;


    return (
        <div>
            <div className="shadow-lg bg-slate-200 p-3 rounded-md m-2 flex flex-col items-center">
                <h1 className="text-3xl items-center">Admin Login</h1>
                <form className='p-3 flex flex-col items-center'>
                    <div>
                        <label htmlFor="username">Username: </label>
                        <input type="text" className="rounded-md p-3 ml-5 mb-5 w-50 " placeholder="Username"
                               {...register("username")}
                        />
                        <div style={{color: "red"}}>
                            {errors.username?.message}
                        </div>
                    </div>
                    <div>
                        <label htmlFor="password">Password: </label>
                        <input type="text" className="rounded-md p-3 ml-6 w-50" placeholder="Password"
                               {...register("first_name")}
                        />
                        <div style={{color: "red"}}>
                            {errors.first_name?.message}
                        </div>
                    </div>

                    <div
                        style={{
                            marginLeft: "30%",
                        }}
                    >
                        <h4>How to show and hide password in ReactJS?</h4>
                        <InputLabel htmlFor="standard-adornment-password">
                            Enter your Password
                        </InputLabel>
                        <Input
                            type={values.showPassword ? "text" : "password"}
                            onChange={handlePasswordChange("password")}
                            value={values.password}
                            endAdornment={
                                <InputAdornment position="end">
                                    <IconButton
                                        onClick={handleClickShowPassword}
                                        onMouseDown={handleMouseDownPassword}
                                    >
                                        {values.showPassword ? <Visibility /> : <VisibilityOff />}
                                    </IconButton>
                                </InputAdornment>
                            }
                        />
                    </div>

                    <button className="bg-red-400 p-3 rounded-md hover:bg-red-200 m-2 ml-2" type="submit">Sign In</button>
                </form>
            </div>
        </div>


    );
};

export default AdminLogin;
